  return (
  <> <header id='header'>
      <label id='matrimony'>Matrimony</label>
      <span id='login'>
        <h5>
          you are already a member?<a href='login'><button>login</button></a>
        </h5>
        </span>

      </header>
      <span id='imgs'>
      <img src='https://th.bing.com/th/id/OIP.qUF_dHdYyCRHobZLvcbd5wHaEK?pid=ImgDet&rs=1' width='100%' height='500px' id='img1'/>
      <img src='https://www.rxwallpaper.site/wp-content/uploads/contact-us-for-wedding-website-indian-marriage-e-invitation-card-800x800.jpg'width='100%' height='500px' />


      </span>
    <h1>Your search for the perfect match ends here!</h1>
    </>
  );
}

export default App;
